import { useEffect, useState } from 'react';
import { Grid, Card, CardMedia, CardContent, Typography, CardActions, Button, Container, TextField, Box, Chip } from '@mui/material';
import { useDispatch } from 'react-redux';
import { addToCart } from '../redux/cartSlice';

const Products = () => {
  const dispatch = useDispatch();
  const [products, setProducts] = useState([]);
  const [filteredProducts, setFilteredProducts] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('all');

  const categories = [
    { id: 'all', label: 'Все' },
    { id: 'iphone', label: 'iPhone' },
    { id: 'mac', label: 'Mac' },
    { id: 'ipad', label: 'iPad' },
    { id: 'watch', label: 'Watch' },
    { id: 'accessories', label: 'Аксессуары' },
  ];

  useEffect(() => {
    // Здесь будет запрос к API
    setProducts([
      {
        id: 1,
        name: 'iPhone 14 Pro',
        price: 99990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/iphone-14-pro-finish-select-202209-6-7inch-deeppurple?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'iPhone 14 Pro с технологией Dynamic Island и передовой системой камер',
        category: 'iphone'
      },
      {
        id: 2,
        name: 'MacBook Air M2',
        price: 129990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/macbook-air-midnight-select-20220606?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'Невероятно тонкий и легкий ноутбук с чипом M2',
        category: 'mac'
      },
      {
        id: 3,
        name: 'iPad Pro 12.9"',
        price: 109990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/ipad-pro-12-11-select-202210?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'iPad Pro с дисплеем Liquid Retina XDR и чипом M2',
        category: 'ipad'
      },
      {
        id: 4,
        name: 'AirPods Pro',
        price: 24990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/MQD83?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'Активное шумоподавление и адаптивный прозрачный режим',
        category: 'accessories'
      },
      {
        id: 5,
        name: 'Apple Watch Ultra',
        price: 79990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/MQDY3ref_VW_34FR+watch-49-titanium-ultra_VW_34FR_WF_CO+watch-face-49-alpine-ultra_VW_34FR_WF_CO?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'Самые прочные и функциональные Apple Watch для экстремальных условий',
        category: 'watch'
      },
      {
        id: 6,
        name: 'HomePod mini',
        price: 12990,
        image: 'https://store.storeimages.cdn-apple.com/4668/as-images.apple.com/is/homepod-mini-select-orange-202110?wid=500&hei=500&fmt=jpeg&qlt=95',
        description: 'Компактная умная колонка с пот��ясающим звучанием',
        category: 'accessories'
      }
    ]);
  }, []);

  useEffect(() => {
    let result = products;

    if (selectedCategory !== 'all') {
      result = result.filter(product => product.category === selectedCategory);
    }

    if (searchQuery) {
      result = result.filter(product => 
        product.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
        product.description.toLowerCase().includes(searchQuery.toLowerCase())
      );
    }

    setFilteredProducts(result);
  }, [products, selectedCategory, searchQuery]);

  return (
    <Container sx={{ py: 4 }}>
      <Box sx={{ mb: 4 }}>
        <TextField
          fullWidth
          label="Поиск товаров"
          variant="outlined"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          sx={{ mb: 2 }}
        />
        <Box sx={{ display: 'flex', gap: 1, flexWrap: 'wrap' }}>
          {categories.map((category) => (
            <Chip
              key={category.id}
              label={category.label}
              onClick={() => setSelectedCategory(category.id)}
              color={selectedCategory === category.id ? 'primary' : 'default'}
              variant={selectedCategory === category.id ? 'filled' : 'outlined'}
            />
          ))}
        </Box>
      </Box>

      <Grid container spacing={4}>
        {filteredProducts.map((product) => (
          <Grid item key={product.id} xs={12} sm={6} md={4}>
            <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
              <CardMedia
                component="img"
                sx={{
                  height: 300,
                  objectFit: 'contain',
                  padding: 2,
                  backgroundColor: '#f5f5f7'
                }}
                image={product.image}
                alt={product.name}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography gutterBottom variant="h5" component="h2">
                  {product.name}
                </Typography>
                <Typography color="text.secondary" sx={{ mb: 2 }}>
                  {product.description}
                </Typography>
                <Typography variant="h6" color="primary" sx={{ fontWeight: 'bold' }}>
                  {product.price} ₽
                </Typography>
              </CardContent>
              <CardActions>
                <Button 
                  size="small" 
                  color="primary"
                  onClick={() => dispatch(addToCart(product))}
                >
                  В корзину
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
      {filteredProducts.length === 0 && (
        <Typography variant="h6" align="center" sx={{ mt: 4 }}>
          Товары не найдены
        </Typography>
      )}
    </Container>
  );
};

export default Products;
